function App() {
  useEffect(() => {
    MovieSearchEngine.GetMovieType("Action");
  }, [])
  return (


    <div className="App">
      <header className="App-header">


        <InputSearch/>
        <SearchButton/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >

        </a>
      </header>
    </div>
  );
}

export default App;
